async function MakeUser(supabase) {
    const { data, error } = await supabase.auth.signUp({
        email: 'example@email.com',
        password: 'example-password',
      })
    if (supabase.auth.getUser()) {
        console.log('user created')
        return true 
    }

    return false


}

export default MakeUser;
